import React from "react";

function Navbar() {
  return (
    <nav>
        <h3>Logo</h3>
        <ul>
            <li>Home</li>
            <li>About Us</li>
            <li>Information</li>
            <li>Resources</li>
            <li>Competitions</li>
            <li>Login</li>
        </ul>
    </nav>
  );
}

export default Navbar;
